  expected_count: 5
  input: 'TEXT,F3A,,"This amendment is for supplemental information for conditionally
    required information. It does not reflect any changes to financial information.  Per
    correspondence dated 8/17/06 from the FEC our reply is as follows regarding procedures
    for procuring conditionally required information per 11CFR S104,3(a)(4)(i) specifically
    employer and occupation information for contributions of $200 or more received.  Our
    procedures for said contribtutions are as follows:  1)  Contribution form on Trauner
    for Congress website which is also given to physicial contributors states ''Federal
    law requires us to our best efforts to collect and report the name, mailing address,
    occupation and name of employer of individuals whose contributions exceed $200
    in a calendar year (or in an election cycle in the case of an unauthorized committee)''.  2)
    upon receipt of qualifying contribution ($200 or more) lacking address or employer/occupation
    information, a phone request is made.  3) If Contributor cannot be reached or
    does not call back in with information by the Friday of the week following said
    deposit, a letter is sent to contributor with a return envelope stating ''Federal
    law requires us to our best efforts to collect and report [whatever specfic info
    is missing] whose contributions exceed $200 in a calendar year (or in an election
    cycle in the case of an unauthorized committee)''.    They are requested to call
    or send a written reply. "'
